import React from "react";

import { Form, Col } from "react-bootstrap";
import Button from "../../../../../../components/Button";
import { StyledButtonGroup } from "./styled-components";
import Input from "../../../../../../components/Input";
import { errorsFormHandler } from "../../../../../../utils";
const EditUserForm = ({
  values,
  handleChange,
  handleSubmit,
  onClose,
  errors,
}) => {
  return (
    <Form onSubmit={handleSubmit}>
      <Form.Row>
        <Form.Group as={Col}>
          <Input
            type="text"
            name="name"
            id="name"
            label="userTable.name"
            value={values.name}
            handleChange={handleChange}
            errors={errors.name}
          />
        </Form.Group>
        <Form.Group as={Col}>
          <Input
            type="text"
            placeholder="Surname"
            name="surname"
            id="surname"
            value={values.surname}
            handleChange={handleChange}
            errors={errors.surname}
          />
        </Form.Group>
        <Form.Group as={Col}>
          <Input
            name="address"
            label="userTable.address"
            handleChange={handleChange}
            type="text"
            value={values.address}
            errors={errors.address}
          />
        </Form.Group>
        <Form.Group as={Col}>
          <Input
            type="email"
            placeholder="Enter email"
            name="email"
            id="email"
            value={values.email}
            handleChange={handleChange}
            errors={errors.email}
          />
        </Form.Group>
        <Form.Group as={Col}>
          <Input
            placeholder="Dni"
            type="text"
            name="dni"
            id="dni"
            value={values.dni}
            handleChange={handleChange}
            errors={errors.dni}
          />
        </Form.Group>
      </Form.Row>
      <StyledButtonGroup>
        <Button
          onClick={() => onClose({ type: "hide" })}
          type="text"
          label="button.cancel"
          variant="cancel"
        />
        <Button
          label={"button.enter"}
          type={!errorsFormHandler(errors) ? "submit" : "text"}
          variant={!errorsFormHandler(errors) ? "confirm" : "disabled"}
        />
      </StyledButtonGroup>
    </Form>
  );
};

export default EditUserForm;
